//import NavBar from "./NavBar";
import logo from "./logo.png";
import RedymadeNavbar from "./RedymadeNavbar";

export default function Redymade()
{
    return(
<div class="container">
    
    <RedymadeNavbar></RedymadeNavbar>

  <h2>Rounded Corners</h2>
  <p>The .img-rounded class adds rounded corners to an image (not available in IE8):</p>            
  <img src={logo} class="img-rounded" alt="Cinque Terre" width="304" height="236" /> 

        
   

</div>



        
    )
}
